import React from 'react';

const Home = () => {
  return (
    <div className="header-section w-100">
    <section class="jumbotron text-center mt-10">
      <div class="container">
      <h1 className="cover-heading">Welcome to Beers & Brewskies!</h1>
      <p className="lead">Take a look around</p>
      <p className="lead">
          <a href="#" class="btn btn-primary my-2">Main call to action</a>
          <a href="#" class="btn btn-secondary my-2">Secondary action</a>
      </p>
      </div>
    </section>
    <div className="overlay"></div>
    </div>
  )
}

export default Home;
